import './CircleCard.css';
export default function CircleCard({children},Src,Alt,href) {
    return(
        <div className="circleCard">
            <img width="25px" src={Src} className="soloIcon" alt={Alt} /><a className="iconText"  href={href}>{children}</a>
        </div>
    );
}
